import { useState, useEffect } from 'react';
import axios from 'axios';
import { Container, Row, Col, Card, Modal, Button, FormControl, Form } from 'react-bootstrap';

const CatGallery = () => {
  const [cats, setCats] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [selectedCat, setSelectedCat] = useState(null);
  const [showModal, setShowModal] = useState(false);
  const [searchTerm, setSearchTerm] = useState('');

  useEffect(() => {
    const fetchCats = async () => {
      try {
        const response = await axios.get('http://localhost:5555/api/cats');
        setCats(response.data);
        setLoading(false);
      } catch (err) {
        setError(err.message);
        setLoading(false);
      }
    };

    fetchCats();
  }, []);

  const handleCardClick = (cat) => {
    setSelectedCat(cat);
    setShowModal(true);
  };

  const handleCloseModal = () => {
    setSelectedCat(null);
    setShowModal(false);
  };

  const filteredCats = cats.filter(cat =>
    cat.name.toLowerCase().includes(searchTerm.toLowerCase())
  );

  if (loading) return <div>Loading...</div>;
  if (error) return <div>Error: {error}</div>;

  return (
    <Container>
      <div style={{margin: '10px 0 60px 0'}}>
        <h1>Cats Gallery</h1>
        <Form inline className="mb-4">
          <FormControl
            type="text"
            placeholder="Search cats"
            className="mr-sm-2"
            value={searchTerm}
            onChange={(e) => setSearchTerm(e.target.value)}
          />
        </Form>
        <Row>
          {filteredCats.map(cat => (
            <Col key={cat._id} sm={6} md={4} lg={3}>
              <Card style={{ marginBottom: '20px', cursor: 'pointer' }} onClick={() => handleCardClick(cat)}>
                <Card.Img variant="top" src={cat.image} style={{ height: '200px', objectFit: 'cover' }} />
                <Card.Body>
                  <Card.Title>{cat.name}</Card.Title>
                  <Card.Text>
                    <strong>Origin:</strong> {cat.origin}
                  </Card.Text>
                </Card.Body>
              </Card>
            </Col>
          ))}
        </Row>

        <Modal show={showModal} onHide={handleCloseModal}>
          <Modal.Header closeButton>
            <Modal.Title>{selectedCat && selectedCat.name}</Modal.Title>
          </Modal.Header>
          <Modal.Body>
            {selectedCat && (
              <div>
                <p><strong>Origin:</strong> {selectedCat.origin}</p>
                <p><strong>Temperament:</strong> {selectedCat.temperament}</p>
                <p><strong>Colors:</strong> {selectedCat.colors.join(', ')}</p>
                <p><strong>Description:</strong> {selectedCat.description}</p>
              </div>
            )}
          </Modal.Body>
          <Modal.Footer>
            <Button variant="secondary" onClick={handleCloseModal}>
              Close
            </Button>
          </Modal.Footer>
        </Modal>
      </div>
    </Container>
  );
};

export default CatGallery;
